import React from 'react';

const Home = () => {
  return (
    // Estilos para forzar el scroll y probar la Navbar
    <div style={{ padding: '100px 20px', minHeight: '200vh', backgroundColor: '#f9f9f9' }}>
      <h1>¡Bienvenido a Mascotas!</h1>
      <p>Contenido principal.</p>
      {/* Relleno para que la página sea larga */}
      <div style={{ height: '1500px' }}></div> 
    </div>
  );
};

export default Home; // ¡CRUCIAL!
